import Vue from 'vue'
import Vuex from 'vuex'
import getters from './getters'
import data from './modules/data.js'
import { user } from "./modules/user.js";

Vue.use(Vuex)

const store = new Vuex.Store({
  modules: {
    data,
    user,
  },
  getters
})
export default store
